Our Dave Banking account includes what we believe are some of the best features and rewards in banking, including:
•Zero account minimums;
•40,000 MoneyPass ATM network locations to make no-fee withdrawals;
•Paychecks delivered up to two days earlier than the scheduled payment date with direct deposit into the Dave Banking account, a feature accessible with no additional mandatory fees;
•Access to mobile wallets such as Apple Pay and Google Pay;
•4% APY accrued on deposits in Members’ Dave Spend Account;
•Free cash deposits with in-app barcode at Walgreens and CVS locations nationwide;
•Free remote check deposit with optional instant fund availability for a fee;
•Round-up feature allowing Members to round-up their debit card transaction into a Goals account which helps Members accumulate savings; and
•Ability to receive discounted ExtraCash instant transfer fees when advances are disbursed to Members' Dave Banking accounts.
Dave Banking offers security controls such as multi-factor authentication, contactless payment, instant card lock and protection against unauthorized purchases if cards are lost or stolen. Our Dave Banking demand deposit accounts are currently issued by Evolve. Evolve is also the issuer of all Dave Banking debit cards and sponsors access to debit networks for payment transactions, funding transactions and associated settlement of funds under a sponsorship agreement with Dave. Evolve also provides sponsorship and support for ACH and associated funds settlement. See “Our Business Model” below for additional information.

