Fraudulent and other illegal activity involving our products and services could lead to reputational damage to us, cause us to incur financial losses, reduce the use of our platform and services and may adversely affect our financial position and results of operations. Criminals are using increasingly sophisticated methods to engage in illegal activities using ExtraCash or deposit account products or Member information. Illegal activities involving products and services like ours often include malicious social engineering schemes, fraudulent payment or refund schemes, fabricated identities, account takeovers, identity theft and other fraudulent schemes. We rely upon third parties for transaction processing services, which subjects us and our Members to risks related to the vulnerabilities of those third parties. A single significant incident of fraud, or increases in the overall level of fraud, involving our products and services, have in the past and could in the future, result in operational losses and reputational damage to us. Such damage could reduce the use and acceptance of our products and services, cause our banking and strategic partners to cease doing business with us, or lead to greater regulation that would increase our compliance costs. Fraudulent activity could also result in the imposition of regulatory sanctions, including significant monetary fines, which could adversely affect our business, results of operations and financial condition.

